      <p>
        &copy; <span>{year}</span> MobileShop.com - All Rights Copyright
        Reserved To{" "}
        <a
          target="_blank"
          rel="noreferrer"
          href="https://www.facebook.com/SamiurRahmanMukul"
        >
          Samiur Rahman Mukul
        </a>
      </p>
    </footer>
  );
}
